import React, { useState, useEffect } from 'react';
import axios from 'axios';
const CategoriesAPI = () => {
	const [categories, setCategories] = useState([]);
	useEffect(() => {
		const getCategories = async () => {
			const res = await axios.get('/api/category');
			console.log(res);
		};
		getCategories();
	}, []);
	return <div></div>;
};

export default CategoriesAPI;
